# Initialisation des listes eventID, MessageID , jobname
NomFic=[]
Eid = []                                  # eventID
Mid = []                                  # Message ID
Jid = []                                  # Informations ID 

for file in os.listdir(getdir):              # parcourir les dichiers log du dossier temp
    # print(file)  
    patern = os.path.splitext(file)         # enlever l'extension txt
    patern = patern[0]                      # recuperer le nom 
    patern = patern.rstrip('log')           # enlever le log
    NomFic.append(patern)                   # Collection des noms des fichiers dans une liste 'NomFic'
    # print("-----------")
    # print(patern)
    # print(type(patern))
    with open(file,'r') as fichier:
        fichier = fichier.read()
        print(fichier)

    # parse event, message et jobname by RE
    eventid = re.compile(r'Event\sId:\s.*')                          # eventid = re.compile(r'Event\sId:\s[0-9]+')
    messageid= re.compile(r'Message\sId\s:\s.*')                     # messageid= re.compile(r'Message\sId\s:\s\w+-?\w+?-?\w+?-?\w?-?[0-9]+')
    jobname= re.compile(r'Message\s:\s.*[\.\:]?')

    matches_events = eventid.findall(fichier)      # creer une fonctionn pour genre les deux boucles
    for value in matches_events:
        e1,e2 = value.split(':')  
        e2 = e2.strip()          
        Eid.append(e2)                      #  recuperation et stockage la liste Eid

    matches_messages = messageid.findall(fichier)
    for message in matches_messages:
        m1,m2 = message.split(':')
        m2 = m2.strip()
        Mid.append(m2)

    matches_jobname = jobname.findall(fichier)
    for jobname in matches_jobname:
        j2,jobname= jobname.split("\t:\n")
        Jid.append(jobname)


